import * as React from 'react';
import {
  Box,
  Container,
  Typography,
  Paper,
  Button,
  useTheme,
  useMediaQuery,
  Grid,
} from '@mui/material';
import MapIcon from '@mui/icons-material/Map';

// Daten für die Sportplätze
const venuesData = [
  {
    id: 1,
    name: 'Marian-Rutka-Platz',
    address: '79108 Freiburg',
    imageUrl: 'https://www.google.com/maps/place/Seepark+Stadion/@48.0124077,7.8186686,3a,75y,90t/data=!3m8!1e2!3m6!1sCIHM0ogKEICAgICp4oS2VA!2e10!3e12!6shttps:%2F%2Flh3.googleusercontent.com%2Fgps-cs-s%2FAC9h4nrdO2GXos1w-yBho8MMU3Js-wTbh0Y5B-1Sbm5BU2GmT84GHoJ6GugvChT7lLs4F2LSrs8vXaC7mK-dSwwBrgyN24S_5PhLYTOqxef2GDyfFy18CmVqoZ03dUwL6vqkhwZCShZa%3Dw129-h86-k-no!7i6240!8i4160!4m16!1m8!3m7!1s0x47911bfa652f0e5d:0xe46f50aea5dfaa3d!2sL%C3%B6rracher+Str.+12,+79115+Freiburg+im+Breisgau!3b1!8m2!3d47.9808942!4d7.8230486!16s%2Fg%2F11y1c2rjh1!3m6!1s0x47911b0a1b9a1c37:0x35d267d40616702d!8m2!3d48.0124077!4d7.8186686!10e5!16s%2Fg%2F11bxc5k38v?entry=ttu&g_ep=EgoyMDI1MDYwMy4wIKXMDSoASAFQAw%3D%3D',
    mapUrl: 'https://www.google.com/maps/place/Marian+Rutka+Platz/@48.0393479,7.8515957,386m/data=!3m1!1e3!4m15!1m8!3m7!1s0x47911ce06e6287d5:0x31c5180a88570c8!2sSportplatz+Post+Jahn,+Schwarzwaldstra%C3%9Fe+189,+79117+Freiburg+im+Breisgau!3b1!8m2!3d47.9892117!4d7.8894597!16s%2Fg%2F11x2h4k2mr!3m5!1s0x47911bf76e7fc355:0xc81e0a93bf9a4df1!8m2!3d48.0398962!4d7.8524517!16s%2Fg%2F11g8v1x3ys?entry=ttu&g_ep=EgoyMDI1MDYwMy4wIKXMDSoASAFQAw%3D%3D',
  },
  {
    id: 2,
    name: 'Seeparkstadion',
    address: 'Siedlerweg, 79110 Freiburg',
    imageUrl: 'https://placehold.co/600x400/111111/00A99D?text=Seeparkstadion',
    mapUrl: 'https://www.google.com/maps/place/Seepark+Stadion/@48.0122702,7.8187205,234m/data=!3m1!1e3!4m15!1m8!3m7!1s0x47911bfa652f0e5d:0xe46f50aea5dfaa3d!2sL%C3%B6rracher+Str.+12,+79115+Freiburg+im+Breisgau!3b1!8m2!3d47.9808942!4d7.8230486!16s%2Fg%2F11y1c2rjh1!3m5!1s0x47911b0a1b9a1c37:0x35d267d40616702d!8m2!3d48.0124077!4d7.8186686!16s%2Fg%2F11bxc5k38v?entry=ttu&g_ep=EgoyMDI1MDYwMy4wIKXMDSoASAFQAw%3D%3D',
  },
  {
    id: 3,
    name: 'Rasenplatz PSV Freiburg',
    address: 'Lörracher Str. 20, 79115 Freiburg',
    imageUrl: 'https://placehold.co/600x400/111111/00A99D?text=Rasenplatz+PSV',
    mapUrl: 'https://www.google.com/maps/place/Polizei-Sportverein+Freiburg+e.V./@47.980813,7.817535,1014m/data=!3m1!1e3!4m12!1m5!3m4!2zNDfCsDU4JzUwLjkiTiA3wrA0OScwMy4xIkU!8m2!3d47.980813!4d7.817535!3m5!1s0x47911b4854640211:0x57dfeef1f77fe0a0!8m2!3d47.9795719!4d7.8176925!16s%2Fg%2F1trtt73g?entry=ttu&g_ep=EgoyMDI1MDYwMy4wIKXMDSoASAFQAw%3D%3D',
  },
];

// Sub-Komponente für eine einzelne Platz-Karte
const VenueCard = ({ venue }) => {
  const theme = useTheme();
  return (
    <Paper
      sx={{
        backgroundColor: '#1C1C1C',
        borderRadius: theme.shape.borderRadius,
        border: `1px solid ${theme.palette.grey[800]}`,
        overflow: 'hidden',
        display: 'flex',
        flexDirection: 'column',
        height: '100%',
        transition: 'transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
        '&:hover': {
          transform: 'translateY(-5px)',
          boxShadow: `0 8px 20px rgba(0, 169, 157, 0.2)`,
        }
      }}
    >
      <Box
        component="img"
        src={venue.imageUrl}
        alt={`Platzhalterbild für ${venue.name}`}
        sx={{
          width: '100%',
          height: 200,
          objectFit: 'cover',
        }}
      />
      <Box sx={{ p: 2, flexGrow: 1, display: 'flex', flexDirection: 'column' }}>
        <Typography 
          variant="h6" 
          component="h3"
          sx={{ fontFamily: 'comfortaa', color: theme.palette.common.white, fontWeight: 'bold' }}
        >
          {venue.name}
        </Typography>
        <Typography 
          variant="body2" 
          sx={{ fontFamily: 'comfortaa', color: theme.palette.grey[400], my: 1, flexGrow: 1 }}
        >
          {venue.address}
        </Typography>
        <Button
          variant="contained"
          href={venue.mapUrl}
          target="_blank"
          rel="noopener noreferrer"
          startIcon={<MapIcon />}
          sx={{
            mt: 'auto', // Button am unteren Rand ausrichten
            fontFamily: 'comfortaa',
            fontWeight: 'bold',
            backgroundColor: '#00A99D',
            color: theme.palette.common.white,
            '&:hover': {
              backgroundColor: '#00877D',
            },
          }}
        >
          Auf Karte anzeigen
        </Button>
      </Box>
    </Paper>
  );
};


const VenuesPage = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <Container maxWidth="lg" sx={{ my: 4, px: isMobile ? 2 : 3 }}>
      <Typography
        variant={isMobile ? 'h4' : 'h3'}
        component="h1"
        sx={{
          mb: 4,
          mt: 2,
          color: '#00A99D',
          fontWeight: 700,
          fontFamily: 'comfortaa',
          textAlign: 'center',
          textTransform: 'uppercase',
          letterSpacing: '0.1em',
        }}
      >
        Unsere Sportplätze
      </Typography>
      
      <Grid container spacing={isMobile ? 3 : 4}>
        {venuesData.map((venue) => (
          <Grid item xs={12} sm={6} md={4} key={venue.id}>
            <VenueCard venue={venue} />
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default VenuesPage;
